import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonInput, IonButton} from '@ionic/react';
import React, { useState} from 'react';
import { Link } from 'react-router-dom';
import './Login.css';

const Register: React.FC = () => {

 const [username, setUsername] = useState('')
 const [password, setPassword] = useState('')
 const [cpassword, setCPassword] = useState('')

function registerUser(){
  console.log(username, password)
}

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Register</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
        <IonInput placeholder="Username"
        onIonChange={(e: any) => setUsername(e.target.value)}></IonInput>  

        <IonInput placeholder="Password"
        onIonChange={(e: any) => setPassword(e.target.value)}></IonInput> 

        <IonInput placeholder="Confirm Password"
        onIonChange={(e: any) => setCPassword(e.target.value)}></IonInput> 

        <IonButton onClick={registerUser}>Register</IonButton>

        <p>Already have an account?<Link to="/login">Login</Link></p>
      </IonContent>
    </IonPage>
  );
};

export default Register;
